+                .type(ConqueryConstants.ID_TYPE)
+                .build());
+        }
+        // Then all columns that originate from selects
+        columnDescriptions.addAll(
+            collectResultInfos(new PrintSettings(true, I18n.LOCALE.get())).getInfos().stream()
